A look at the life of activist, musician, and cultural icon Kathleen Hanna, who formed the punk band Bikini Kill and pioneered the &quot;riot grrrl&quot; movement of the 1990s.

This was recorded from a tablet running itunes with a screen capture, so the quality leaves something to be desired. Obviously, if you support indie efforts like this, see the real deal in theaters when you can, or buy the DVD.

Rock on!
